export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},gCvINeMHQH:{data:{id:256,attributes:{imdbId:"tt5592248",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTg5NjY3NDYxMl5BMl5BanBnXkFtZTgwMjI5ODgyMjI@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.3\u002F10"},{Source:"Rotten Tomatoes",Value:"79%"},{Source:"Metacritic",Value:"77\u002F100"}],item_lang:{data:{id:919,attributes:{title:g,plot:"Three years into the American Civil War, in 1864, the dilapidated mansion of Miss Martha Farnsworth's Seminary for Young Ladies is still running, occupied by the matriarch, a teacher, and five students in Spanish-moss-draped Virginia. However, when a young student stumbles upon Corporal John McBurney, a wounded Union deserter on the verge of death, the already frail balance of things will be disrupted, as the hesitant headmistress decides to take him in to heal from his injury. Little by little, as the unwelcome guest arouses an uneasy sexual excitation among the women of the secluded boarding school, it is not before long that they will find themselves competing for the alluring man's favour. Undoubtedly, this handsome devil is a manipulator; nevertheless, will the ladies stay forever beguiled by his charm?",slug:"the-beguiled"}}},books:{data:[{id:2800,attributes:{title:h,description:i,thumbnail:j,authors:[b],firstBook:true,published:k,publisher:l,subtitle:m}},{id:2801,attributes:{title:h,description:i,thumbnail:j,authors:[b],firstBook:d,published:k,publisher:l,subtitle:m}},{id:2802,attributes:{title:g,description:a,thumbnail:a,authors:[b],firstBook:d,published:"1966-01-01",publisher:a,subtitle:a}},{id:2803,attributes:{title:"The Bedeviled (Valancourt 20th Century Classics)",description:"Maggie Caine and her family leave New York to visit the Caine family home, an old farmhouse in Ohio, which her husband has just inherited from a distant aunt. The house, ten miles away from the nearest neighbor, was once owned by a Civil War general reputed to have been a Satanist. But when strange and terrible things begin to happen it soon becomes clear that Satanic worship is still alive and well in the community, and so might be the General, who Maggie suspects is taking possession of her teenage son . . . A rediscovered modern horror classic by Thomas Cullinan, author of the twice-filmed Civil War horror novel The Beguiled, The Bedeviled (1978) is an occult chiller whose suspenseful plot and surprising twists will keep readers on the edge of their seats until the shocking finale. \"Suspenseful . . . Cullinan does not take the easy way out, and never tries to explain things away by natural causes. The ending is bitter and scary.\" - The New York Times \"Horror that should keep exorcism fans up all night.\" - Publishers Weekly \"A good old-fashioned supernatural thriller. A bit of incest, brutal murders and other eerie occurrences all make a heady brew. It's plain and simple scary.\" - Memphis Press Scimitar",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=F5XGyAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2019-06-11",publisher:a,subtitle:a}},{id:2804,attributes:{title:"The Eighth Sacrament",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=LrNF671lCkMC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1977-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681309142013}}("","Thomas Cullinan","movie",null,"series",1,"The Beguiled","The Beguiled (Movie Tie-In)","The basis for the major motion picture directed by Sofia Coppola—named best director at the Cannes Film Festival for The Beguiled—and starring Nicole Kidman, Colin Farrell, Kirsten Dunst, and Elle Fanning “[A] mad gothic tale . . . The reader is mesmerized with horror by what goes on in that forgotten school for young ladies.” —Stephen King, in Danse Macabre Wounded and near death, a young Union Army corporal is found in the woods of Virginia during the height of the Civil War and brought to the nearby Miss Martha Farnsworth Seminary for Young Ladies. Almost immediately he sets about beguiling the three women and five teenage girls stranded in this outpost of Southern gentility, eliciting their love and fear, pity and infatuation, and pitting them against one another in a bid for his freedom. But as the women are revealed for what they really are, a sense of ominous foreboding closes in on the soldier, and the question becomes: Just who is the beguiled?","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=SUxUDgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2017-06-13","Penguin","A Novel"))